import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import { GlobalStyle } from '@styles/globalStyles';
import Navbar from '@components/navigation/Navbar';

const App = () => {
	return (
		<>
			<GlobalStyle />
			<BrowserRouter>
				<Navbar />
				<Routes>
					<Route></Route>
				</Routes>
			</BrowserRouter>
		</>
	);
};

export default App;
